import { BrowerRouter, Routes, Route } from "react-router-dom"; //Browerser router wraps everywhere we are going to use our router
//Routes component wraps all the indivudual routes
//Indivudual route component to create a single route
//pages and componenets
import Home from "./pages/Home";
function App() {
  return (
    <div className="App">
      <BrowerRouter>
        <div className="pages">
          <Routes>
            <Route path="/" element={Home}></Route>
          </Routes>
        </div>
      </BrowerRouter>
    </div>
  );
}

export default App;
